import './App.css';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import loginComponent from '../routes/logincomponent';

function App() {
  return (
    <div>
      <BrowserRouter>
        <Routes>
          <Route path='/login' element={<loginComponent />}></Route>
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
